DROP TABLE IF EXISTS communes;

CREATE TABLE `communes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cp` varchar(6) NOT NULL,
  `name` varchar(50) NOT NULL,
  `lat` varchar(50) NOT NULL,
  `lon` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=468 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS locations;

CREATE TABLE `locations` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `addate` datetime NOT NULL,
  `uid` varchar(50) DEFAULT NULL,
  `title` varchar(128) DEFAULT NULL,
  `url` varchar(128) DEFAULT NULL,
  `image` varchar(128) DEFAULT NULL,
  `cp` varchar(6) DEFAULT NULL,
  `ville` varchar(50) NOT NULL,
  `loyer` int(11) DEFAULT NULL,
  `surface` int(11) DEFAULT NULL,
  `status` char(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=259 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS ventes;

CREATE TABLE `ventes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `addate` datetime NOT NULL,
  `uid` varchar(50) DEFAULT NULL,
  `title` varchar(128) DEFAULT NULL,
  `url` varchar(128) DEFAULT NULL,
  `image` varchar(128) DEFAULT NULL,
  `cp` varchar(6) DEFAULT NULL,
  `ville` varchar(50) DEFAULT NULL,
  `prix` int(11) DEFAULT NULL,
  `surface` int(11) DEFAULT NULL,
  `status` char(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=191 DEFAULT CHARSET=latin1;




